import React from 'react';
import './Hero.css';

const Hero2 = () => {
  return (
    <section className="hero">
      <h1>About Me</h1>
      <p>Hey, I am Sarvagya, an Electrical Engineering and Computer Science major at University of California Berkeley, dedicated to pushing boundaries and driving innovation in the world of technology.</p>

      <p>Currently pursuing my Bachelor's of Science degree in EECS at UC Berkeley, I have been fortunate to be part of an exceptional academic environment that has nurtured my passion for problem-solving and critical thinking. Through rigorous coursework, I have developed a strong foundation in algorithms, data structures, software development, and more.</p>

      <p>I am interested in Software Development, Machine Learning and Artificial Intelligence and their real world applications.</p>
    </section>
  );
};

export default Hero2;
